import { Link } from "react-router-dom";
import Add from "../components/Add";
import View from "../components/View";
import Category from "../components/Category";

function Home() {
    return (
        <div>
            <div className="container  d-flex justify-content-between align-items-center mt-5 mb-5">
                <div className="add_videos">
                <Add/>
                </div>
                <div>
                <Link to={'/Watch'} style={{ fontFamily: "-moz-initial", fontSize: "30px", textDecoration: "none", color: "white" }}> Watch History</Link>
                </div>
                
            </div>
            <div className="container  d-flex justify-content-between  mt-5 mb-5">
            <div className="all-videos col-md-6 ">
                <h4 style={{fontFamily:"-moz-initial"}}>All Videos</h4>
               <View/>
                </div>
                <div>
                    <Category/>
                </div>
            

            </div>
          
        </div>
    )
}
export default Home;
